import React from "react";

import "../styles.css";

function Note(props) {
    return (
        <div className="note col-md-3 col-lg-3">
            <p className="note-title">{props.title}</p>
            <p className="note-content">{props.content}</p>
        </div>
    );
}

export default Note;
